'''Lara Pulver''' (born 1 September 1980) is an English actress. She is known for her roles in the television series ''Robin Hood'', ''True Blood'', ''Spooks'', ''Sherlock'', ''Skins: Fire'', ''Da Vinci's Demons'' and ''Fleming: The Man Who Would Be Bond'' and the film ''Edge of Tomorrow''.

In ''[[Game of Thrones: A Telltale Games Series]]'', she voices Lady [[Elissa Forrester]].
